    "report": "",
    "analysis": "Hilliard was targeted only twice, catching a two-yard pass. Hilliard now 19 carries for 166 yards (8.73 YPC) since first seeing action off the practice squad last week, but his fumble today was a back-breaker, costing the Titans at least three points near the end of the first half. Hilliard was at the end of a 32-yard run when\u00a0Davon Godchaux simply grown man'd the ball out of his hands. Hilliard did save face when a simple, clock-killing draw call somehow turned into a 68-yard touchdown at the 0:37 mark of the second quarter. Backfield mate D'Onta Foreman also cleared 100 yards and lost a fumble as the Titans finally got their post-Derrick Henry rushing attack on track. Coach Mike Vrabel has a week to think about it with the Titans headed on bye, but we would expect a similar two-headed approach vs. the cellar-dwelling Jaguars in Week 14. Despite today's nonexistent receiving performance, Hilliard should probably help out in that department moving forward. He is a viable FLEX.\u00a0\n",
