    "headlineNews": "Panthers placed Christian McCaffrey (ankle) on injured reserve, ruling him out for the remainder of the season.\n",
    "report": "",
    "analysis": "McCaffrey has already been on injured reserve once this season due to a hamstring injury. Players who are put on injured reserve a second time are not allowed to return, meaning this second stint ends his 2021 season. McCaffrey suffered the ankle injury in his fourth game back from the hamstring issue. He appeared to roll his ankle in the first half of his Week 12 game versus the Dolphins and did not return in the second half. It was previously reported that an x-ray did not reveal any serious issues and that McCaffrey might have been able to return after the team's Week 13 bye. Further testing obviously revealed the injury to be much worse, but the Panthers are also fourth in their division and trending in the wrong direction with no capable quarterback on the roster. Giving McCaffrey the rest of the season to get ahead on rehab makes sense for a team that is likely looking toward the future. ESPN's David Newton added that he won't need surgery and should be ready for the 2022 season. Chuba Hubbard averaged 21 touches for 83 yards in his five starts earlier this year. He'll slot in as a volume-based RB2 once the Panthers return from their bye. McCaffrey's season ends with 442 rushing yards and 343 receiving yards across seven games. When healthy, he remained the best fantasy option in the league. After playing just 10 games over the past two years, his health is no longer a given. Expect him to be drafted early in the first round of fantasy drafts next year, although the days of him as the 1.01 may be over.\n",
