    "headlineNews": "NFL Network's Ian Rapoport reports Kenyan Drake has been diagnosed with a broken right ankle is done for the season.\u00a0\n",
    "report": "",
    "analysis": "This was the fear after Drake got his ankle pinned underneath him in ugly fashion on Sunday afternoon. Drake also dealt with ankle issues in 2020, though this was not an \"injury prone\"-type of issue. This was \"a grown man just fell on my ankle\"-type of issue. Drake had been more involved in the Raiders' offense since Jon Gruden's firing/Henry Ruggs' release, though he was still rarely seeing more than 10 handles per game. The biggest fantasy impact of his injury is going to be the extra targets it sends Josh Jacobs' way. Jacobs caught a career-high nine balls on Sunday, though that was with Jalen Richard on the COVID-19 list. It's possible the lifer passing-down back Richard starts claiming some third-down reps in the highly-paid Drake's absence. One month shy of his 28th birthday, Drake's bloated salary includes $5.5 million in 2022 guarantees, so he will be back in Vegas with his 53-man roster spot intact. Considering his age, role, and now this injury, however, he doesn't have much of a Dynasty league future.\u00a0\n",
