    "headlineNews": "Ezekiel Elliott has forced 15 missed tackles on 160 rushing attempts this season, according to Pro Football Focus.\u00a0\n",
    "report": "",
    "analysis": "Elliott's stunning lack of elusiveness was on full display Thursday night against New Orleans. Reportedly hobbled by a bruised knee he suffered in Week 4, Elliott was again slow and ineffective on his 13 carries for 45 yards. PFF rates him as the tenth least elusive running back in the NFL this season, comparable to backs like David Johnson, Carlos Hyde, and Latavius Murray. For context, Dalvin Cook has forced 37 missed tackles on 172 carries this season and Nick Chubb has forced 41 missed tackles on 150 attempts. Tony Pollard, who had another long touchdown run in Dallas' win over the Saints, has forced 23 missed tackles on 100 carries. Pollard has the 13th highest breakaway percentage, per PFF, while Zeke is 37th in breakaway rate. Pollard drafters can only hope rational coaching takes hold in Dallas and Elliott is used as a 1B back behind Pollard as the team's 1A down the regular season's final stretch. We wouldn't bet on it though.\u00a0\n",
